    }
    .radio-group input[type="radio"] {
      margin-right: 5px;
    }
    .radio-group label {
      margin: 0;
    }
    .checkbox-group {
      display: flex;
      flex-wrap: wrap;
      gap: 10px;
    }
    .checkbox-group label {
      display: flex;
      align-items: center;
      gap: 5px;
    }
  </style>
</head>
<body>
  <div class="form-container">
    <form (ngSubmit)="onSubmit()">
      <div *ngFor="let complication of complications; let i = index">
        <h1>  Thrombose de l'artère centrale de la rétine   - {{ i + 1 }}</h1>
     

        <!-- Thrombose de l'artère centrale de la rétine -->
        <div>
          <label>Thrombose rénale:</label>
          <div class="radio-group">
            <input type="radio" id="ThromboseRenale1Oui-{{i}}" [(ngModel)]="complication.ThromboseRenale1" [value]="true" name="ThromboseRenale1-{{i}}">
            <label for="ThromboseRenale1Oui-{{i}}">Oui</label>
            <input type="radio" id="ThromboseRenale1eNon-{{i}}" [(ngModel)]="complication.ThromboseRenale1" [value]="false" name="ThromboseRenale1-{{i}}">
            <label for="ThromboseRenale1Non-{{i}}">Non</label>
          </div>
        </div>

        <!-- Nombre -->
        <div *ngIf="complication.ThromboseRenale1">
          <label for="Nombre-{{i}}">Nombre:</label>
          <input type="number" id="Nombre-{{i}}" [(ngModel)]="complication.Nombre" name="Nombre-{{i}}">
        </div>

        <!-- Date -->
        <div *ngIf="complication.ThromboseRenale1">
          <label for="Date-{{i}}">Date :</label>
          <input type="date" id="Date-{{i}}" [(ngModel)]="complication.Date" name="Date-{{i}}">
        </div>
    
  

        <!-- Symptomatologie -->
        <div class="conditional-fields" *ngIf="complication.ThromboseRenale1">
            <label for="Symptomatologie-{{i}}">Symptomatologie:</label>
            <div class="checkbox-group">
              <label>
                <input type="checkbox" id="DouleursAbdominales-{{i}}" [(ngModel)]="complication.DouleursAbdominales" name="DouleursAbdominales-{{i}}">
                Douleurs Abdominales
              </label>
              <label>
                <input type="checkbox" id="HematurieMacroscopique-{{i}}" [(ngModel)]="complication.HematurieMacroscopique" name="HematurieMacroscopique-{{i}}">
                Hématurie Macroscopique
              </label>
              <label>
                <input type="checkbox" id="HematurieMicroscopique-{{i}}" [(ngModel)]="complication.HematurieMicroscopique" name="HematurieMicroscopique-{{i}}">
                Hématurie Microscopique
              </label>
              <label>
                <input type="checkbox" id="DouleursLombaires-{{i}}" [(ngModel)]="complication.DouleursLombaires" name="DouleursLombaires-{{i}}">
                Douleurs Lombaires
             </label>
             <label>
                <input type="checkbox" id="Hta{{i}}" [(ngModel)]="complication.Hta" name="Hta{{i}}">
                 HTA
             </label>
             <label>
                <input type="checkbox" id="OligoAnurie-{{i}}" [(ngModel)]="complication.OligoAnurie" name="OligoAnurie-{{i}}">
                Oligo Anurie
             </label>
             <label>
                <input type="checkbox" id="GrosRein-{{i}}" [(ngModel)]="complication.GrosRein" name="GrosRein-{{i}}">
                Gros Rein 
             </label>
             <label>
                <input type="checkbox" id="InsuffisanceRenale-{{i}}" [(ngModel)]="complication.InsuffisanceRenale" name="InsuffisanceRenale-{{i}}">
                Insuffisance Rénale   
             </label>
              <label>
                <input type="checkbox" id="Autre-{{i}}" [(ngModel)]="complication.Autre" name="Autre-{{i}}">
                Autre
              </label>
            </div>
          </div>
          <!-- Preciser autre -->
        <div *ngIf="complication.ThromboseRenale1 && complication.Autre">
            <label for="PreciserAutre-{{i}}">Preciser Autre:</label>
            <input type="text" id="PreciserAutre-{{i}}" [(ngModel)]="complication.PreciserAutre" name="PreciserAutre-{{i}}">
          </div>

          <!-- Urée (mmol/l)   -->
          <div *ngIf="complication.ThromboseRenale1">
            <label for="Uree-{{i}}"> Urée (mmol/l)  :</label>
            <input type="number" id="Uree-{{i}}" [(ngModel)]="complication.Uree" name="Uree-{{i}}">
        </div>
        <!-- Créatinémie (gmol/l)  -->
        <div *ngIf="complication.ThromboseRenale1">
            <label for="Ceatinemie-{{i}}"> Créatinémie (gmol/l)   :</label>
            <input type="number" id="Ceatinemie-{{i}}" [(ngModel)]="complication.Ceatinemie" name="Ceatinemie-{{i}}">
        </div>
            <!-- Hospitalisation -->
            <div *ngIf="complication.ThromboseRenale1">
                <label for="Hospitalisation-{{i}}"> Hospitalisation:</label>
                <input type="checkbox" id="Hospitalisation-{{i}}" [(ngModel)]="complication.Hospitalisation" name="Hospitalisation-{{i}}">
            </div>
            <!-- Lieu hospitalisation -->
            <div *ngIf="complication.ThromboseRenale1 && complication.Hospitalisation">
                <label for="LieuHospitalisation-{{i}}">Lieu Hospitalisation:</label>
                <input type="text" id="LieuHospitalisation-{{i}}" [(ngModel)]="complication.Lieu" name="LieuHospitalisation-{{i}}">
            </div>
            <!-- Echodoppler Rénale -->
            <div *ngIf="complication.ThromboseRenale1">
                <label for="EchodopplerRenale-{{i}}"> Echodoppler Renale:</label>
                <input type="checkbox" id="EchodopplerRenale-{{i}}" [(ngModel)]="complication.EchodopplerRenale" name="EchodopplerRenale-{{i}}">
            </div>
            <!-- Preciser -->
            <div *ngIf="complication.ThromboseRenale1 && complication.EchodopplerRenale">
                <label for="Preciser-{{i}}">Preciser:</label>
                <input type="text" id="Preciser-{{i}}" [(ngModel)]="complication.Preciser" name="Preciser-{{i}}">
            </div>
             

        <!-- Traitement -->
        <div class="conditional-fields" *ngIf="complication.ThromboseRenale1">
          <label for="Traitement-{{i}}">Traitement:</label>
          <div class="checkbox-group">
            <label>
              <input type="checkbox" id="AntalgiquesPalliesI-{{i}}" [(ngModel)]="complication.AntalgiquesPalliesI" name="AntalgiquesPalliesI-{{i}}">
              Antalgiques pallier I
            </label>
            <label>
              <input type="checkbox" id="AntalgiquePallierIi-{{i}}" [(ngModel)]="complication.AntalgiquePallierIi" name="AntalgiquePallierIi-{{i}}">
              Antalgique pallier II
            </label>
            <label>
              <input type="checkbox" id="AntalgiquePallierIii-{{i}}" [(ngModel)]="complication.AntalgiquePallierIii" name="AntalgiquePallierIii-{{i}}">
              Antalgique pallier III
            </label>
            <label>
              <input type="checkbox" id="HyperhydratationPerso-{{i}}" [(ngModel)]="complication.HyperhydratationPerso" name="HyperhydratationPerso-{{i}}">
              Hyperhydratation perso
            </label>
            <label>
              <input type="checkbox" id="HyperhydratationIv-{{i}}" [(ngModel)]="complication.HyperhydratationIv" name="HyperhydratationIv-{{i}}">
              Hyperhydratation IV
            </label>
            <label>
              <input type="checkbox" id="TransfusionSimple-{{i}}" [(ngModel)]="complication.TransfusionSimple" name="TransfusionSimple-{{i}}">
              Transfusion simple
            </label>
            <label>
                <input type="checkbox" id="EchangeTransfusionnel-{{i}}" [(ngModel)]="complication.EchangeTransfusionnel" name="EchangeTransfusionnel-{{i}}">
                Echange transfusionnel
              </label>
              <label>
                <input type="checkbox" id="EpurationExtraRentale-{{i}}" [(ngModel)]="complication.EpurationExtraRentale" name="EpurationExtraRentale{{i}}">
                Epuration Extra Réntale  
              </label>
            
          </div>
        </div>

      </div>
      
      <div class="submit-row">
        <input type="button" (click)="addComplication()" value="Ajouter Crise ">
      </div>
      <div class="submit-row">
        <input type="submit" value="Submit">
      </div>
    </form>
  </div>
</body>
</html>
